        path="/"
        element={
          <CelebretiesBox
            imageAdress="https://img.search.brave.com/vA74am6tIKPW-2lfknJ6b3bHrvx1Igj_XCSJVUp4awA/rs:fit:1024:769:1/g:ce/aHR0cHM6Ly93d3cu/Y2hlYXRzaGVldC5j/b20vd3AtY29udGVu/dC91cGxvYWRzLzIw/MTkvMTIvUmloYW5u/YS0yLTEwMjR4NzY5/LmpwZw"
            nameCeleb="Rihanna"
          />
        }
      />
    </Routes>
  );
}

export default App;
